import React from 'react';
import './dbutton.styles.scss';
const DButton = ({children,inverted,...otherprops}) => (
    <button {...otherprops} className={`${inverted?'inverted':''} customButton`} {...otherprops}>
        {children}
    </button>
)
export default DButton;
